    def setUserInformation(self, account):
        self.account = account
        sql = "SELECT users.user_name, users.account, users.teacher_id, teacher_name," \
          "institute_name,user_type FROM users,teachers,institute " \
          "WHERE users.teacher_id = teachers.teacher_id and " \
          "teachers.institute_id = institute.institute_id " \
          "and users.account = '{}'".format(account)
        self.query = Query()
        result = self.query.fetch(sql)
        self.label_7.setText(str(result[0][0]))
        self.label_8.setText(str(result[0][1]))
        self.label_9.setText(str(result[0][2]))
        self.label_10.setText(str(result[0][3]))
        self.label_11.setText(str(result[0][4]))
        if result[0][5] == 1:
            self.label_12.setText('拥有')
        else:
            self.label_12.setText('无')

